import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BrowserRouter>
        <switch>
            <Route to="/" exact/>
            <Route to="usersList" exact />
            <Route to="addUser" exact />
        </switch>
        </BrowserRouter>
      </header>
    </div>
  );
}

export default App;
